import React from 'react';
import { Link } from 'react-router-dom';
import carImage from '../assets/car-image.png'; // Ensure the correct path to your car illustration image

function HeroSection() {
  return (
    <section className="hero-section">
      <div className="container">
        <div className="hero-content text-center">
          <h1 className="hero-title">WASH MY CARS</h1>
          <img src={carImage} alt="Car Illustration" className="hero-image" />
          <nav className="hero-nav">
            <Link to="/" className="hero-link">Home</Link>
            <Link to="/services" className="hero-link">Services</Link>
            <Link to="/process" className="hero-link">Process</Link>
            <Link to="/pricing" className="hero-link">Pricing</Link>
            <Link to="/contact" className="hero-link">Contact</Link>
            <Link to="/register" className="hero-link">Register</Link>
          </nav>
        </div>
      </div>
    </section>
  );
}

export default HeroSection;
